import "./topBar.css";

export default function TopBar() {
  return (
    <div className="topBar">
      <div className="topBarWrapper">
        <div className="topLeft">
          <span className="logo">Admin Board</span>
        </div>
        <div className="topRight">Right</div>
      </div>
    </div>
  );
}
